import React, {useState, useEffect} from 'react'
import { Document, Page, pdfjs } from 'react-pdf'

import pdf_ from '/src/pages/pdf/ClaudeShannonInformationTheoryPaper.pdf'

export const Resume = () => {
  const [numPages, setNumPages] = useState(null);
  const [pageNumber, setPageNumber] = useState(1);

  useEffect(() => { 
    pdfjs.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/$%7Bpdfjs.version%7D/pdf.worker.js%60;%7D'
  });
  function onDocumentLoadSuccess({ numPages }) {
    setNumPages(numPages);
  }

  return (
    <div>
      <Document file={pdf_} onLoadSuccess={onDocumentLoadSuccess}>
        <Page pageNumber={pageNumber} />
      </Document>
      <p>
        Page {pageNumber} of {numPages}
      </p>
    </div>
  );
}
